import React from 'react';

const ProjectCard = ({ name, description, photoUrl, color }) => {  // Destructure the props
    return (
        <div style={{ ...styles.card, backgroundColor: color }}> {/* Apply dynamic background color */}
            <p style={styles.name}>{name}</p>
            <img src={photoUrl} alt="Project Image" style={styles.photo} /> {/* Corrected src to photoUrl */}
            <p style={styles.description}>{description}</p>
        </div>
    );
};

const styles = {
    card: {
        padding: '20px',
        borderRadius: '8px',
        width: '40%',
        flexDirection: 'column',
        gap: '10px',
        display: 'flex',
        borderRadius: '5px',
        borderColor: '#2a2829',
    },

    name: {
        fontSize: '20px',
        fontWeight: 'bold',
        color: '#e0e0dc',
    },

    photo: {
        width: '90%',
    },

    description: {
        fontSize: '27px',
        color: '#e0e0dc',
    },
}

export default ProjectCard;
